import React from "react";
import "./style.css";

function TitleBox () {
    return (
        <div>
            <div id="text-box">
            <h2>Botanical image library</h2>
            <h1>Truffle</h1> 
            </div>

            <div id="image-box">
                            
            </div>
        </div>

        
    );
}

export default TitleBox;
